        {...props}
      >
        Log out
      </button>
      {console.log(user)}
      {user?.name}

      <button onClick={() => {
        console.log(token())
        dispatch(BoPList(token()))
      }}>api</button>
    </div>

  ) : null;
}

export default LogoutButton;
